import React from 'react';
import PortfolioItem from './PortfolioItem';
import DigitalImg from '../imgs/digital.png';
import HandDoneGraphic from '../imgs/hand.png';
import TechnicaLogo from '../imgs/technica-circle.png';
import VideoGraphic from '../imgs/play-pause.png';
import SculpeyLogo from '../imgs/Sculpeylll-logo.png';

const Portfolio = () => {
    return (
        <div>
            <section>
                <h2 className="title">Works I've done</h2>
            </section>

            <section className="padded">
                <div className="container ">
                    <div className="row wrap">
                        <PortfolioItem 
                            path="/graphic-design" 
                            image={DigitalImg} 
                            altText="Digital Graphic" 
                            css="width:90%"
                            color="green" 
                            name="Graphic Design" >
                        </PortfolioItem>

                        <PortfolioItem 
                            path="/hand-done" 
                            image={HandDoneGraphic} 
                            altText="Hand Done Graphic" 
                            css="width:90%"
                            color="brown" 
                            name="Hand Done" >
                        </PortfolioItem>

                        <PortfolioItem 
                            path="/technica" 
                            image={TechnicaLogo} 
                            altText="Technica Logo" 
                            css="height:15rem"
                            color="green" 
                            name="Technica" >
                        </PortfolioItem>

                        <PortfolioItem 
                            path="/videos" 
                            image={VideoGraphic} 
                            altText="Video Graphic" 
                            css="width:18rem"
                            color="brown" 
                            name="Videos" >
                        </PortfolioItem>

                        <PortfolioItem 
                            path="/polymer-clay" 
                            image={SculpeyLogo} 
                            altText="Sculpey Logo"
                            css="width:80%" 
                            color="green" 
                            name="Polymer Clay" >
                        </PortfolioItem>
                    </div>
                </div>
            </section>
        </div>

    );
};

export default Portfolio;
